import wx
import base64
import io


def icon_001():
    return ""


def getIcon(icon_data):
    """
    
    :param icon_data: egicon_001()
    :return obj:wx.Icon()
    """
    try:
        stream = io.BytesIO(bytearray(base64.b64decode(icon_data)))
        image = wx.Image(stream, wx.BITMAP_TYPE_ANY)
        bitmap = wx.Bitmap(image)
        icon = wx.Icon(bitmap)
        return icon
    except Exception as e:
        print(e)
        return wx.Icon()